import './App.css';
import { useState, useEffect } from 'react';
import UserEntry from './UserEntry';
import HomePage from './HomePage'

function App() {
  const [logedIn, setLogedIn] = useState(false);
  return (
    <div className="App">
      {!logedIn && <HomePage />}
      {logedIn && <UserEntry />}
    </div>
  );
}

export default App;
